import React, { Component } from 'react'
import { connect } from 'react-redux';
import { ButtonSearch } from '../../components/Buttons/Button';
import * as AuthActions from '../../store/actions/actions';

import Header from '../../components/Header/Header';

class Home extends Component {
  render() {
    return (
      <div>
      <Header 
        titleBrand="AwesomePokedex"
        labelButton="Buscar"
      />
      <ButtonSearch backgroundColor="green" color="white" labelutton="Pokedex"/>

      </div>
    )
  }
}

export default connect(null, AuthActions)(Home);
